import React, { useState, useEffect }  from 'react';

import classes from './css/Stack.module.css';

const StackCategory = (props) => {
    return(
        <div>

            <h2 style={{textAlign: 'center'}}>props.title</h2>
            <ul className={classes['flex-container']}>
            <img src='https://upload.wikimedia.org/wikipedia/commons/thumb/c/c3/Python-logo-notext.svg/2048px-Python-logo-notext.svg.png'
            style={{
                position: 'relative',
                left: '15%',
                marginRight: '250px',
                height: '125px',
                width: '125px', }}
            />
            <img src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTu4Rn2qYr3scKHHSQWqGWvCO7M67MkJeO04g&usqp=CAU'
            style={{
                position: 'relative',
                left: '15%',
                marginRight: '250px',
                height: '125px',
                width: '125px', }}
            />
           <img src='https://e7.pngegg.com/pngimages/46/626/png-clipart-c-logo-the-c-programming-language-computer-icons-computer-programming-source-code-programming-miscellaneous-template.png'

            style={{
                position: 'relative',
                left: '15%',
                marginRight: '250px',
                height: '125px',
                width: '125px', }}
            />

            </ul>


        </div>
    )
}

const Stack = () => {
    const text = {
        'text-align': 'center',
        'position': 'relative',
        'top': '50%',
        'left': '50%',
        'margin-right': '-50%',
        'transform': 'translate(-50%, -50%)',
        'color': 'white'
    };

    const [languageImages, setLanguageImages] = useState([]);
    const imageUrls = [
        'https://upload.wikimedia.org/wikipedia/commons/thumb/c/c3/Python-logo-notext.svg/2048px-Python-logo-notext.svg.png',
        'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTu4Rn2qYr3scKHHSQWqGWvCO7M67MkJeO04g&usqp=CAU',
        'https://e7.pngegg.com/pngimages/46/626/png-clipart-c-logo-the-c-programming-language-computer-icons-computer-programming-source-code-programming-miscellaneous-template.png'
    ]
    useEffect(() => {
        setLanguageImages(imageUrls);
    })

    const Languages = languageImages.map((language) => 
    <img 
    src={language} 

    style = {{
    position: 'relative',
    left: '15%',
    marginRight: '250px',
    height: '125px',
    width: '125px', }}
    />
    )

    return(
        <>
            <h1 style={text}>My Stack</h1>

            <StackCategory
            title="My Technical Stack"
            />



        </>
    )
}

export default Stack;
